INSERT INTO ATTRIBUTE VALUES (17,8712,'The geographical co-ordinates can be stored in two different ways: decimal degrees or degrees, minutes and seconds in separate fields. You are free to choose whatever system is easier for you.\nDegrees west should be indicated with a minus sign in the decimal degrees fields or labelled with &#147;E&#148; or &#147;W&#148; in the appropriate field when using degrees, minutes and seconds in separate fields.\nAlthough over the last years, many sites have been given co-ordinates, many other sites still have missing co-ordinates for some countries.\n\nAny point within the boundary of the designated area is considered to be correct. In the case of &#147;multi-polygon&#148; areas, expert judgement should provide the best location of the central point, usually within the largest sub-area.\n\nYou are asked to do an extra effort to find and enter those co-ordinates! The use of GIS data to fill those fields is highly recommended, especially for countries that have already boundary information in a GIS format available.','E');
