INSERT INTO ATTRIBUTE VALUES (17,729,'Over the last few years, several requests for validation and updating of data concerning designated areas at national level were sent to an agreed point of contact to the member countries of the EEA as a common request by EEA, Council of Europe and WCMC. Comments were received from several countries and amendments were made accordingly and its quality has improved considerably. \nIt was for the first time agreed in the NFP-EIONET meeting in February 1999 to establish a regular electronic data flow from member states using EIONET telematics infrastructure.\nFrom than on, countries should provide on a regular basis their data on nationally designated areas using the facilities of EIONET and CIRCLE. \n\nThe EEA is now extending this process to the new member countries and the candidate countries.\n\nAs it was for the first set of countries, there is a need to solve remaining questions and inconsistencies or incompleteness in the database, which are still hampering its full use.\n\nThe current CDDA database on nationally designated areas contains two products:\n\n- List of designation types at national or sub-national level, according to the typology developed in the Standard Data Form for Natura2000 under the Habitats Directive or the Emerald network under the Bern Convention (A, B and C types: see below)\n- The sites data base for those designation types which create sites networks\n\n\nThe data for each country are distributed in one MS-Access file \"CDDA-XX-YYYYMM\" with three tables:\n\n- Designations-XX: list of designation types\n- Sites-XX: table of nationally designated areas\n- Siterelations-XX: table indicating the site relationships\n\n\"XX\" - stands for the IS0 2 character country code\n\"YYYY\" - stands for the year in which the file was created\n\"MM\" - stands for the month in which the file was created\n\nThe guidelines are structured in three different sections:\n\n- country specific questions for both tables (questions-XX-YYYYMM)\n- guidelines for updating the list of nationally designated areas (CDDA-guidelines-YYYYMM)\n- guidelines for updating of individual site records (CDDA-guidelines-YYYYMM)','DS');
