INSERT INTO ATTRIBUTE VALUES (17,8701,'The IUCN management categories according to the new system (!) (IUCN (1994), Guidelines for Protected Area Management Categories). They are summarised as follows:\n\nI	Strict Nature Reserve/Wilderness Area: protected area managed mainly for science or wilderness protection\nIa	Strict Nature Reserve: protected area managed mainly for science\nIb	Strict Nature Reserve: protected area managed mainly for wilderness protection\n\nII	National park: protected area managed mainly for ecosystem protection and recreation\nIII	Natural Monument: protected area managed mainly for conservation of specific natural features\nIV	Habitat/Species Management Area: protected area managed mainly for conservation through management intervention\nV	Protected Landscape/Seascape: protected area managed mainly for landscape/seascape conservation and recreation\nVI	Managed Resource Protected Area: protected area managed mainly for the sustainable use of natural ecosystems\n\nSites with missing IUCN category are marked with either a blank field or &#147;?&#148; or &#147;UA&#148; which stands for &#145;Unassigned&#146;. It&#146;s especially those records which should be corrected and if possible a category should be given taking in to account the criteria for the application of the categories.\n\nYou may concentrate as a priority on sites &gt;1000 ha, but from a European point of view you are stimulated to indicate the management category also for smaller areas.\n\nAn explanation about the application of the management category in your countries, especially difficulties encountered should be documented, to be able to &#147;understand&#148; the reason for empty fields.','E');
