INSERT INTO ATTRIBUTE VALUES (17,8694,'For countries, which have so called &#147;DOM/TOM&#146;s&#148; or any kind of over seas territories under their jurisdiction, the ISO3 country code may be different from the parent country code. (e.g. &#147;FRA&#148; and &#147;GLP&#148; for Guadeloupe. This difference is made for easy integration in the Worlds data base on the one hand and easy administration on the other hand. In this way, countries are contacted only once for information about designated areas within the whole geographical area under their jurisdiction.\nIn most countries the ISO3 and PARENT_ISO codes are identical!','E');
