INSERT INTO ATTRIBUTE VALUES (17,8676,'This field accumulates codes given in appendix D of the NATURA 2000 or Emerald Standard Data Form. For countries which have not yet checked the data through the EIONET data flow process, it is still possible to find abbreviations that were already present in the common database on nationally designated areas.\nIf such abbreviations are still present in your country database, they should be either removed if the designation type does not correspond to an existing type in the law or they should be transformed to the coding principles explained above.\nFor designations that are not yet present, a new code is to be given following the coding principles in the appendix of the NATURA 2000 and Emerald Standard Data Form. \nAfter your validation, a definitive code will be given in co-ordination with ETC/NPB. This code is to be considered to be the EUNIS code for national designation types.','E');
