INSERT INTO ATTRIBUTE VALUES (4,1137,'The average discharge/flow at each river station for each year (either measured or calculated), and the long term annual averages for each station','T');
INSERT INTO ATTRIBUTE VALUES (15,1137,'Table contains information about average discharge/flow at each river station for each year','T');
INSERT INTO ATTRIBUTE VALUES (17,1137,'We are also asking for the average discharge/flow at each river station for each year (either measured or calculated), and the long term annual averages for each station (see Table 7.3).  The flow information is required in order to interpret the riverine load data.  For direct discharges we are requesting annually aggregated load data for each sea area.  Thus the identifier used for the sea area in terms of direct discharges must equate to the identifier used for sea area into which the riverine load discharges.  This is to ensure that we can relate riverine loads to direct discharge loads.','T');
