INSERT INTO ATTRIBUTE VALUES (17,1136,'We are asking for annually aggregated load information for each river station used in calculating riverine loads entering your sea (see Table 7.2). We require the national station identifiers and details of the sea area into which the river discharges, along with details of the regional sea that it is part of (e.g. Celtic Sea, Bothnian Bay).','T');
