INSERT INTO ATTRIBUTE VALUES (4,1119,'For an estimation of the extent of &#147;brownfield&#148;-problems information about the annual consumption of &#147;green land&#148; and the total area and accrual of brown-fields per year is of interest.','T');
INSERT INTO ATTRIBUTE VALUES (15,1119,'Table contains information about reused (reclaimed) brown-fields in relation to consumed green land','T');
INSERT INTO ATTRIBUTE VALUES (17,1119,'In this context a &#147;brownfield-site&#148; is characterised by the following parameters:\n&#183; affected by former uses of the site and surrounding land\n&#183; derelict or underused\n&#183; real or perceived contamination problems\n&#183; situates in mainly or partly developed urban areas\n&#183; require intervention to bring them back to beneficial use','T');
INSERT INTO ATTRIBUTE VALUES (1,1119,'Reused (reclaimed) brown-fields in relation to consumed green land','T');
