INSERT INTO ATTRIBUTE VALUES (15,1118,'Table contains information about expenditures','T');
INSERT INTO ATTRIBUTE VALUES (17,1118,'Costs for remediation highly depend on the legal background and local land conditions. Nevertheless information is important so that this matter is duly considered.','T');
INSERT INTO ATTRIBUTE VALUES (1,1117,'Incidences of groundwater/drinking water affected by local soil contamination','T');
INSERT INTO ATTRIBUTE VALUES (15,1117,'Table contains information about incidences of groundwater/drinking water','T');
INSERT INTO ATTRIBUTE VALUES (17,1117,'Information on the impact of local soil contamination on public or private drinking water supply facilities can be gained for instance through the number of closed-down drinking-water supply facilities, the number of installed purification facilities for drinking water or costs which were caused due to such measures.','T');
INSERT INTO ATTRIBUTE VALUES (1,1116,'Progress in the management of contaminated sites','T');
INSERT INTO ATTRIBUTE VALUES (15,1116,'Table contains information about management of contaminated sites','T');
INSERT INTO ATTRIBUTE VALUES (17,1116,'The management of local soil contamination is a tiered approach. The following processing steps can be distinguished:\n\nStep Activity Result\n\nStep: Preliminary survey. Activity: Negative effects on human health and the environment suspected. Result: Existence of potential contamination detected\nStep: preliminary investigation. Activity: Verification of negative effects on human health or the environment. Result: Existence of contamination verified\n(definition of impact level maybe)\nStep: main site investigation. Activity: Quantification of negative effects on human health or the environment. Result: Extent of contamination determined\n(definition of impact level)\nStep: Implementaion of remediation activities. Activity: Detailed planning of measures to reduce the degree of negative effects on human health or the environment, start of activities. Result: Detailed remediation plan, activities started\nStep: Remediation completed. Activity: Clean-up and/or safety measures to reach specific quality targets. Result: Reduction of impacts caused by contaminated sites\n\nThe progress in local soil contamination management is expressed by the current state in relation to the estimated total effort for reaching a &#147;target-line&#148;.\nRough estimation of the total effort for the management of local contamination per processing step.','T');
INSERT INTO ATTRIBUTE VALUES (4,1115,'Impact of hazardous substances on soil &#150; CHC, mineral oil','T');
INSERT INTO ATTRIBUTE VALUES (15,1115,'Table contains information about impact of hazardous substances','T');
INSERT INTO ATTRIBUTE VALUES (17,1115,'Estimation of the extent of hazardous substances in soil and groundwater due to local soil contamination.','T');
INSERT INTO ATTRIBUTE VALUES (1,1115,'Impact of hazardous substances','T');
INSERT INTO ATTRIBUTE VALUES (1,1114,'Groundwater aggregated quality data','T');
INSERT INTO ATTRIBUTE VALUES (4,1114,'The number and main purpose of the sampling sites','T');
INSERT INTO ATTRIBUTE VALUES (17,1114,'If you prefer to submit aggregated data the following information is required for each groundwater body. \n&#183; aggregated data on nitrate, ammonium, nitrite, dissolved oxygen and pesticides according to the Excel form GG_CC xxx.XLS.\n&#183; aggregated data on pesticides according to the Excel form GQPesti_CC1xxx.XLS.\n&#183; information on the type of sampling site and monitoring frequency\nQuality data should be based on available data and be provided as proposed in the Guidelines &#150; EEA Technical Report No. 7 (1998). The results for one sampling site should be aggregated as annual mean value. The results of individual monitoring points within a groundwater body should be aggregated for the groundwater body as a whole. (see Excel-file GQ_CC1xxx.XLS and GQPesti_CC1xxx.XLS)\nFill in data in the Excel-files (GQ_CC1xxx.XLS). There are separate data sheets called: ammonium, nitrite, nitrate and dissolved oxygen. With regard to the pesticides please use the Excel-file GQPesti_CC1xxx.XLS and use separate data sheets for each pesticide.\nUse one separate file for each groundwater body and add the EWN-code of the groundwater body into the file name.','T');
INSERT INTO ATTRIBUTE VALUES (1,1113,'Groundwater disaggregated quality data','T');
INSERT INTO ATTRIBUTE VALUES (17,1113,'In order to keep your effort and amount of time for delivering data as small as possible, we offer to undertake the aggregation of delivered data and suggest that you submit disaggregated (raw) data at monitoring site level. This would allow for more flexibility (e.g. regarding different concentration classes) when aggregating data and ensure the consistent treatment of values below the limit of quantification and the limit of detection.\nInformation required is:\n&#183; general information on the monitoring site (name, co-ordinates, type of use, well or spring)\n&#183; additional information on the co-ordinate system if co-ordinates are provided\n&#183; quality data for the determinands (NO3, HN4, NO2, O2, Pesticides) e.g.:\n&#183; 12.5 or\n&#183; &lt;12.5 (below the limit of quantification) or\n&#183; [12.5] (below the limit of detection)','T');
INSERT INTO ATTRIBUTE VALUES (1,1112,'General characterisation','T');
INSERT INTO ATTRIBUTE VALUES (15,1112,'Table about station general characterisation','T');
INSERT INTO ATTRIBUTE VALUES (17,1112,'Please provide/complete a general characterisation (in accordance with the guidelines) for those groundwater bodies on which information is available.\n- A list of the information required and a help-file including details on definitions is available: Excel-files GWLST_CC .XLS and GG_help.DOC.\n- It will be possible to submit the general characterisation via the Internet by filling in an online-form. The account is password-protected and data provision and update will be possible by direct access to the database. Only authorised partners will have access to their own data. Please use the on-line form if possible! The Internet-address will be distributed to the relevant person as soon as the contact person is announced.\n- If you prefer to use the Excel-files, use one separate file for each groundwater body.','T');
INSERT INTO ATTRIBUTE VALUES (1,1111,'Groundwater monitoring sites','T');
INSERT INTO ATTRIBUTE VALUES (17,1111,'In order to keep your effort and amount of time for delivering data as small as possible, we offer to undertake the aggregation of delivered data and suggest that you submit disaggregated (raw) data at monitoring site level. This would allow for more flexibility (e.g. regarding different concentration classes) when aggregating data and ensure the consistent treatment of values below the limit of quantification and the limit of detection.\nInformation required is:\n&#183; general information on the monitoring site (name, co-ordinates, type of use, well or spring)\n&#183; additional information on the co-ordinate system if co-ordinates are provided\n&#183; quality data for the determinands (NO3, HN4, NO2, O2, Pesticides) e.g.:\n&#183; 12.5 or\n&#183; &lt;12.5 (below the limit of quantification) or\n&#183; [12.5] (below the limit of detection)','T');
INSERT INTO ATTRIBUTE VALUES (1,1110,'List of Groundwater Bodies','T');
INSERT INTO ATTRIBUTE VALUES (4,1110,'Characteristics of Groundwater Bodies. Please provide/complete a LIST of all groundwater bodies within your country which fulfil the criteria of the guidelines (EEA Technical Report No. 7 (1998)). Additionally, add some key information on each groundwater body, if available.','T');
INSERT INTO ATTRIBUTE VALUES (17,1110,'Selection of groundwater bodies\nThe information and data obtained through EUROWATERNET is derived from existing national and/or regional monitoring networks within each Member Country. For EUROWATERNET-Groundwater Member Countries have been asked to select important groundwater bodies according to criteria described in the technical guidelines (EEA Technical Report No. 7 (1998)). These groundwater bodies are expected to be able to provide a general overview, based on truly comparable data, of the water quality of groundwaters on the European level. \nImportant groundwater bodies as defined in the guidelines meet at least one of the three requirements below:\n- &gt; 300 km&#178;;\n- of regional, socio-economic or environmental importance in terms of quantity and quality;\n- exposed to severe or major impacts.','T');
