INSERT INTO ATTRIBUTE VALUES (17,1107,'As for EUROWATERNET-Basic we also request information on the physical characteristics of each of the monitoring stations. This information is used in the interpretation of the data and to ensure that like is compared with like. The requested information and data fields are shown in the Table below.','T');
INSERT INTO ATTRIBUTE VALUES (1,1106,'Impact - quality data','T');
INSERT INTO ATTRIBUTE VALUES (15,1106,'Table contains disaggregated data of priority substances','T');
INSERT INTO ATTRIBUTE VALUES (17,1106,'The collection of disaggregated data for priority substances will necessitate the definition of more fields within Waterbase. This will include a field for the limit of detection, limit of determination , a flag field for when samples are below the limit of detection, day and month of sampling. The LoD is that concentration for which there is a desirably small probability that the determinand will not be detected (usually with 95% confidence).\n  The smallest concentration that can be distinguished from the analytical blank at a chosen level of statistical confidence (usually 95%).','T');
