INSERT INTO ATTRIBUTE VALUES (4,1104,'ANNEX 1: STRUCTURE REQUIRED FOR THE SUBMISSION OF AGGREGATED DATA FOR EUROWATERNET-BASIC NETWORK FOR RIVERS (SEE EXCEL SPREADSHEET','T');
INSERT INTO ATTRIBUTE VALUES (4,1103,'One area can be designated by a set of different designations partly or completely overlapping each','T');
INSERT INTO ATTRIBUTE VALUES (15,1103,'This table allows to indicate neighbouring sites or sites belonging to different designation types which overlap or neighbour each other.','T');
INSERT INTO ATTRIBUTE VALUES (17,1103,'One area can be designated by a set of different designations partly or completely overlapping each other. For each of these designation types, a separate record should be present in the previous file. This file allows to indicate neighbouring sites or sites belonging to different designation types which overlap or neighbour each other.\n\nThe table structure is summarised in the box below. A short description of the content of each of the fields can be found in the paragraphs below.\n\nThis table can only be filled if boundary information is available for a significant part of all designation types described. The relational data are the only way to produce reliable statistics on surface area covered by different designation categories !','T');
INSERT INTO ATTRIBUTE VALUES (1,1103,'Site relations','T');
INSERT INTO ATTRIBUTE VALUES (4,1102,'Tthe information on the individual designated areas at national level','T');
INSERT INTO ATTRIBUTE VALUES (15,1102,'Summary table about sites with geographical co-ordinates','T');
INSERT INTO ATTRIBUTE VALUES (17,1102,'1. Correct and/or update the individual site records, concentrating on the particular questions and missing information indicated in the summary table for your country. Especially the geographical co-ordinates are important in the light of the foreseen uses of the data base. The content of each of the fields is explained in the guidelines.\n\n2. Add additional records for missing or newly created site\n\nThe table \"Sites-XX\" contains the information on the individual designated areas at national level.\nInformation on the following fields is requested and entered in the data base for the site records for each designation type creating \"sites\" (the field \"CDDA sites\" in the designations table must be set to \"yes\"):','T');
INSERT INTO ATTRIBUTE VALUES (1,1102,'Sites Data','T');
INSERT INTO ATTRIBUTE VALUES (4,1101,'List of designations for country.','T');
INSERT INTO ATTRIBUTE VALUES (15,1101,'Table contains the list of designations and references to laws','T');
INSERT INTO ATTRIBUTE VALUES (17,1101,'A. List of National Designation Types:\n\n1. Check whether the list of designation types (in file designations-XX, where \"XX\" stands for the ISO 2 character code) is up to date for your country, including category B and C!. Many existing records need to be completed. Especially, indicate the law, including the paragraph concerned, and make reference to the Official Journal in which the law was published. \nAs this code list of designations is linked to several other European and World initiatives, any deletions or additions should be discussed with ETC/NPB (Marc Roekaerts, eureko@pophost.eunet.be ).\nFor accession countries and countries building up the emerald network under the Bern Convention, the results in the framework of setting up a list of national designation types as annex to the Standard Data Form of Natura2000 and Emerald should be taken in to account. Only one list of designation types should be created !\n\n2. Many of the designation types do not build up site networks, but they protect the full distribution of particular features (e.g. habitats) or they are related to some kind of zoning system within specific sectors. Tick the logical field \"CDDA sites\" for those designation types for which sites should be in the CDDA sites data base, even if no data are yet in the CDDA sites data base. If the sites are not present in the database enter the new data, in electronic form, including the data for the fields as explained below or explain the reason for their absence in the remark field.\n\n3. Check if the number of sites and total surface area in fields \"number\" and \"total area\" (only given for information as an extract from the common data base on nationally designated areas) correspond to the actual situation. The corrections and/or updates as explained in step B should eliminate any difference between the actual situation and the figures given.','T');
INSERT INTO ATTRIBUTE VALUES (1,1101,'List of National Designation Types','T');
