INSERT INTO ATTRIBUTE VALUES (17,736,'Determinands and supporting information required for EUROWATERNET\n\nIt is our aim to make proposals consistent as far as possible with other requirements and initiatives such as the WFD and EUNIS.  We will be requesting data from three different environmental compartments: water column, sediment and biota.  It will be necessary to know what compartments are sampled at each station.  Not all stations will sample all compartments.\n\nThe EUROWATERNET data request will be an annual event and the data will ultimately be uploaded annually from the working database (WATERBASE-TCM) to the Reference WATERBASE, along with the other water datasets.  In the near future we will also be requesting data on the biological communities of transitional, coastal and marine waters.  These aspects will also be simultaneously developed for rivers and lakes.\n\nThe following Tables list the information we are requesting under EUROWATERNET- Transitional, Coastal and Marine Waters.\n \nTable 6.1 denotes the physical characteristic data required for each transitional, coastal and marine water monitoring station.  \n\nTables 6.2, 6.3 and 6.4 contain details of the data relating to concentrations of determinands in water column, biota and sediment measured at each station.  The concentration values of each determinand are requested.  \n\nTable 6.5 contains a list of the proxy pressure information required.\n\nData should be submitted using Excel spreadsheets or ASCII text files (tab or semi-colon separated) based on the structure and layout of the Excel templates provided.  (EWN_TCM_Concentrations.xls.) \n\n	Riverine loads and direct discharges \ninto marine waters\n\nWe also require aggregated information on the riverine loads and the loads from direct discharges to Europe&#146;s Seas.  This is to be based on the information submitted to the Regional Sea Conventions and is summarised below in Table 7.1.  Some of this information is reported on an annual basis (such as for the OSPAR RID programme) whilst information for the Baltic Pollution Load Compilation is only collected on a 5-yearly basis.  Our aim is to gain as complete a temporal (years) and spatial (countries and sea regions) coverage as possible.  \nWe are asking for annually aggregated load information for each river station used in calculating riverine loads entering your sea (see Table 7.2). We require the national station identifiers and details of the sea area into which the river discharges, along with details of the regional sea that it is part of (e.g. Celtic Sea, Bothnian Bay).  We are also asking for the average discharge/flow at each river station for each year (either measured or calculated), and the long term annual averages for each station (see Table 7.3).  The flow information is required in order to interpret the riverine load data.  For direct discharges we are requesting annually aggregated load data for each sea area.  Thus the identifier used for the sea area in terms of direct discharges must equate to the identifier used for sea area into which the riverine load discharges.  This is to ensure that we can relate riverine loads to direct discharge loads.\nAs for the EUROWATERNET data, this information will be used to formulate indicators for use in the EEA&#146;s assessments and reports.  \nIt should be noted that the EEA/ETC-WTR has developed EUROWATERNET-Emissions, which will be used in the future to collect disaggregated source-oriented information on pollutant loads to surface waters.  This will eventually be used to supplement the load information requested here.  EUROWATERNET-Emissions is also consistent with the requirements of the IPPC Directive (e.g. for an EPER) and with the HARP initiative. \nWe ask that each country supplies data using the templates provided (EWN_TCM_Inputs.xls).  Each template refers to one Marine Convention and details the relevant countries and sea areas for which data is required.','DS');
